package edu.mednikov.dp

import org.junit.jupiter.params.ParameterizedTest
import org.junit.jupiter.params.provider.Arguments
import org.junit.jupiter.params.provider.MethodSource
import java.util.stream.Stream
import kotlin.test.assertEquals

class JumpGameVII1871Test {

    @ParameterizedTest
    @MethodSource("arguments")
    fun test(s: String, minJump: Int, maxJump: Int, expected: Boolean) {
        assertEquals(
            expected,
            JumpGameVII1871().canReach(s, minJump, maxJump),
        )
    }

    companion object {
        @JvmStatic
        fun arguments(): Stream<Arguments> {
            return Stream.of(
                Arguments.of("011010", 2, 3, true),
                Arguments.of("01101110", 2, 3, false),
                Arguments.of(
                    "",
                    5, 99998, true),
            )
        }
    }
}